export default function App() {
  const[msg,setMessage]=useState('bien venu visiteur')
  const[btn,setBtn]=useState('inscription')
  function change(){
    setBtn('merci')
    setMessage('votre inscription est effectuee')
  }
  return (
    <div>
      <b>{msg}</b> 
      <div><button>{btn}</button></div>
    </div>
  )
}
